import React from "react";

function Game() {
	return (
		<div className="game">
			<div class="container">
				<div class="row align-items-cente p-5">
					<iframe
						src="https://i.simmer.io/@Xenolht/cali-jam"
						height="750"
						width="960"
					></iframe>
				</div>
				<h1 class="text-center display-5 py-3">Welcome to our game!</h1>
				<p>Controls:</p>
			</div>
		</div>
	);
}

export default Game;
